import React, { Component } from 'react';
class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
            <img 
            src="https://coinrussia.ru/wp-content/uploads/2018/11/Depositphotos_206337806_l-2015-1.jpg"
            alt="new"
            width={1250} 
            height={560}
            />

        );
    }
}

export default Home;
